public class GraphQLApiFactory(string resourceName = null, Action<Humidifier.AppSync.GraphQLApi> factoryAction = null) : ResourceFactory<Humidifier.AppSync.GraphQLApi>(resourceName)
{

    internal List<InnerGraphQLApiAdditionalAuthenticationProviderFactory> AdditionalAuthenticationProvidersFactories { get; set; } = [];

    internal InnerGraphQLApiOpenIDConnectConfigFactory OpenIDConnectConfigFactory { get; set; }

    internal InnerGraphQLApiEnhancedMetricsConfigFactory EnhancedMetricsConfigFactory { get; set; }

    internal InnerGraphQLApiLambdaAuthorizerConfigFactory LambdaAuthorizerConfigFactory { get; set; }

    internal InnerGraphQLApiUserPoolConfigFactory UserPoolConfigFactory { get; set; }

    internal InnerGraphQLApiLogConfigFactory LogConfigFactory { get; set; }

    protected override Humidifier.AppSync.GraphQLApi Create()
    {
        var graphQLApiResult = CreateGraphQLApi();
        factoryAction?.Invoke(graphQLApiResult);

        return graphQLApiResult;
    }

    private Humidifier.AppSync.GraphQLApi CreateGraphQLApi()
    {
        var graphQLApiResult = new Humidifier.AppSync.GraphQLApi
        {
            GivenName = InputResourceName,
        };

        return graphQLApiResult;
    }
    public override void CreateChildren(Humidifier.AppSync.GraphQLApi result)
    {
        base.CreateChildren(result);

        result.AdditionalAuthenticationProviders = AdditionalAuthenticationProvidersFactories.Any() ? AdditionalAuthenticationProvidersFactories.Select(x => x.Build()).ToList() : null;
        result.OpenIDConnectConfig ??= OpenIDConnectConfigFactory?.Build();
        result.EnhancedMetricsConfig ??= EnhancedMetricsConfigFactory?.Build();
        result.LambdaAuthorizerConfig ??= LambdaAuthorizerConfigFactory?.Build();
        result.UserPoolConfig ??= UserPoolConfigFactory?.Build();
        result.LogConfig ??= LogConfigFactory?.Build();
    }

} // End Of Class

